import { Routes, Route, Outlet} from 'react-router-dom';
import Home from './routes/home/home.component.jsx';

const Navigation = () => {
  return (
    <div>
      <Outlet />
    </div>
  )
}
const App = () => {
  return (
    <Routes>
    <Route path='/' element = {<Navigation/>}>
      <Route path = '/home' index element = { <Home />} />
      </Route>
    </Routes>
  );
};

export default App;
